@eventful_erin X @drinkmomwater one year celebration ☁️

feeling very blessed today and everyday to do what I love. Thank you to every person who has trusted me with helping plan their special event in 2022 and into 2023! I’m so happy a year ago I took this risk without knowing the outcome. Also so happy to be working with @drinkmomwater to celebrate! This is very special because my mom is the one who believed in me when I didn’t believe in myself.

Charleston in-person events coming soon….🔑

